import React from "react";
import { MapContainer, Marker, Popup, TileLayer } from "react-leaflet";
import { Icon } from "leaflet";import "./Map.css";
import marker from "../asset/marker.png";
import L from "leaflet";
import axios from "axios";
import {useState, useEffect} from "react";


function Map() {

   let Icon = L.icon({
    iconUrl: marker,
    iconSize: [35, 35],
    });


    const baseUrl = "http://localhost:8000/api/partners";
    const [partners, setPartners] = useState([]);
    // const handelClick = () =>{rest(!setRest)};

      useEffect(() => {
         axios.get(baseUrl).then((response) => {
          setPartners(response.data);
          // console.log(partners)
        });
        }, []);
        if (!partners) return null;

  return (
    <div>
        <div> <h1 className="title_Partners"> écologie, commerces, boite alimentaire </h1></div>
            <div><span className="commerce_partners">Retrouvez les commerces, restaurants et traiteurs partenaires</span></div>
                <div><h2 className="explane_partners">Venez découvrir tous nos partenaires orléanais pour qui l'écologie à de l'importance et 
                  régalez-vous de mets délicieux dans nos boîtes en verre consignées.</h2></div>
       <div className="map_list_legend_container">
       <div className="map_legend">
         ou nous trouvez
       </div>

        <div className="list_map_container">
            <div className="partners_list_container">
                  {partners.map((partners) => (
                  <ul className="partners_list_">  
                    <li className="partners_list">
                    <li className="List_name_partners"> {partners.company}</li>
                    <li className="Horaire_partners">Horaires {partners.horaires}</li>
                    <li className="Tel">Tel : {partners.phone}</li>
                    <li className="adresse">  {partners.delivery_adress}</li>
                    <li className="code_postal">code postale : {partners.post_code_delivery}</li>
                    <li className="ville">Ville : {partners.city_delivery}</li>
                    </li>
                  </ul> ))}

      <div className="map_block">
         <MapContainer className="map_container" center={[47.90170, 1.90301]} zoom={10}>
           <TileLayer
             url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
               />
                {partners.map((partners, index) => (
              <Marker  
                icon={Icon}
                 key={index}
                  position={[
                   47.861165,
                    1.8189589,
                     ]}
                    onClick={() => {
                     setPartners(partners);
                      }}
                        >
                <Popup
                    position={[
                    47.861165[1],
                      1.8189589[0],
                      ]}
                        onClose={() => {
                          setPartners(null);
                          }}
                            >

                <div>
                  <a href={partners.picture_path} target='blank' className="partners_site">Faire un Réservation<img className="back_img" src={partners.picture_path} alt={partners.company}></img></a>
                    <h2 className="Name_partners">Nom : {partners.company}</h2>
                      <h2 className="Planing_Horaire">Horaires : {partners.horaires}</h2>
                        <h2 className="Phone_Tel">Tel : {partners.phone}</h2>
                          <h2 className="adresse">Adresse : {partners.delivery_adress}</h2>
                            <h2 className="Poste_code">code postale : {partners.post_code_delivery}</h2>
                              <h2 className="City_ville">Ville : {partners.city_delivery}</h2>
                  </div>                  
             </Popup>
          </Marker>
          ))},
         </MapContainer>
         </div>
        </div>
       </div>
      </div>
    </div>
  )
};

export default Map
